import Button from "./Button"

export default function NavBar() {

    return(
        <>
        <div>
        <Button  text='Nosotros' /> 
        <Button  text='Productos'/> 
        <Button  text='Logistica'/> 
        <Button  text='Contactos'/> 
        </div>
    </>
    )
}
